import React from 'react'

export default function Tokenpairs(props) {
    var pairs = []
    var img1 = props.token.logo
    var img2 = ""
    for (let i = 0; i < props.token.pairIds; i++) {
        for (let b = 0; b < props.tokens.length; b++) {
            if (props.relToken===props.tokens[b].contract){
                img2=props.tokens[b].logo;
            }
        }
        pairs.push(
            props
        )
    }
    return (
        <div className={"section " + props.cn}>
            pairs
        </div>
    )
}
